// eslint-disable-next-line
import {HomePage} from "./pages/index";
function App() {
  return (
    <BrowserRouter>
     <Routes>
       <Route path="/" element={<HomePage />} />
       <Route path="/info" element={<InfoPage />} />
     </Routes>
   </BrowserRouter>

  );
}

export default App;
